insert into products(id, description, image_url, price, rating, shelf_life, title)
VALUES (1,
        'Долгоиграющее натуральное лакомство, богатое легкоусвояемым белком, аминокислотами, микроэлементами и витамином В. А также благодаря волокнам, из которых состоит бычий корень, прекрасно чистит зубы от налета, укрепляет десна и челюстные мышцы вашей собаки. Отлично подходит для щенков в период смены зубов. Регулярное употребление бычьего корня поможет наладить пищеваренье, нормализовать стул и аппетит. 100% натуральный продукт без добавок и консервантов. Состав: бычий корень 100% % Пищевая ценность в 100 гр. продукта: белки – 15 гр., жиры – 5 гр. Энергетическая ценность: 105 ккал.',
        'https://res.cloudinary.com/ddbqvzsqy/image/upload/v1675526492/products/%D0%B1%D1%8B%D1%87%D0%B8%D0%B9_%D0%BA%D0%BE%D1%80%D0%B5%D0%BD%D1%8C_qvyc7v.png',
        310, 5, '12 месяцев при температуре от +5С до +20С при влажности не более 75%', 'Бычий корень в нарезке');

insert into products(id, description, image_url, price, rating, shelf_life, title)
VALUES (2,
        'Низкокалорийное, постное Лакомство, богатое хрящевой и соединительной тканью. Продукт содержит большое количество коллагена и эластина, которые помогут укрепить связки и суставы Вашего питомца, а также улучшить состояние шерсти и кожи. Трахея богата кальцием, поэтому такое угощение будет полезно щенкам в период активного роста, смены зубов и взрослым собакам для укрепления хрящевой ткани. Витамин Д помогает усвоению кальция в костном скелете, Калий поддерживает работу сердца, и регулирует водно-солевой баланс в организме. Трахея прекрасно очищает и укрепляет зубы и десна собак, поэтому при регулярном использовании является профилактикой зубного камня. Состав: трахея говяжья 100%',
        'https://res.cloudinary.com/ddbqvzsqy/image/upload/v1675526498/products/%D1%82%D1%80%D0%B0%D1%85%D0%B5%D1%8F_%D0%B3%D0%BE%D0%B2%D1%8F%D0%B6%D1%8C%D1%8F_q0snfb.png',
        200, 5, '12 месяцев при температуре от +5С до +20С при влажности не более 75%', 'Бычий корень в нарезке');

