        'Это вкусное лакомство, которое богато калием, йодом, железом, магнием, витаминам группы В, D и А. А также носы говяжьи насыщены фолиевой кислотой, которая необходима для развития иммунной и кровеносной системы Вашего питомца. Носы говяжьи очищают зубы от налета и камня, укрепляет десна, тренирует челюсть, также укрепляют хрящевую ткань за счет высокого содержания белка и коллагеновых волокон.Состав: носы говяжьи 100%Пищевая ценность в 100 гр. продукта: белки 25.6 г, жиры 2.3 г, Энергетическая ценность: 122 ккал',
